# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - flask.Flask~Subclass
    - flask_caching
    - Member[Flask]
  - - flask.Response~Subclass
    - flask_caching
    - Member[CachedResponse]
  - - flask.Response~Subclass
    - flask_caching
    - Member[Response]
  - - markupsafe.Markup~Subclass
    - flask_caching
    - Member[Markup]
  - - pickle~Alias
    - flask_caching
    - Member[backends].Member[memcache].Member[pickle]
  - - pickle~Alias
    - flask_caching
    - Member[backends].Member[rediscache].Member[pickle]
